The Cover draws parallels between love and dancing...
Dancing, like love, can bring glorious technicolor to our lives. It can be passionate, intense, beautiful, and can make the world go round while being rooted in one place. The rhythms of the symphony and the dance moves flow like water, like moments, one into another; suspended for a long time, yet passing so quick.
Dance is like that young love which feels like a fresh breeze on your face while walking on the beautiful USC campus. It comes from nowhere, and everywhere, it makes us feel hopeful, sweeps us off our feet and fills our minds with vivid  daydreams. 
This is a three-part story showing a journey through a whirlwind romance of dance between two people who live to dance.
@appielife 

📍Location: USC Fountains, Los Angeles, California
🎥 Videographers: Rahul Baboota, Vaibhav Gera, Sachin Gupta

